review_text:
일요일이라 사람 없고 좋네요~~
주중엔 많지만^^;;;
넓고 좌석도 편하고 이야기하기도 좋아요~~

여느 스벅과 달리 주문시 매징섭취라고 하면 “자리 잡으셨나요?”라고 묻는곳^^;
앉을 엄두가 안나는, 이용자 많은 스벅 중 한곳이예요
테이크아웃이 정답ㅋ

텀블러에 내용물흘리고..닦지도않고 그냥주네요ㅠㅠ
양쪽으로 흘려 손에 다묻고..ㅠㅠ
아침부터 좀그러네요...아우^^;;;;

커피주는 직원(?)이 친절하다 느낌은 없었지만 ;;
(빨대껍데기 쓰레기통 커피나오는데 있으면 좋겠어요ㅎ....)
주차되고 매장넓어요!
